      SELECT DISTINCT + + 32 + - cor0.col1 AS col2 FROM tab0 (FORMAT parquet), tab2 (FORMAT parquet) AS cor0, tab1 (FORMAT parquet) AS cor1, tab2 (FORMAT parquet), tab2 (FORMAT parquet) AS cor2;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q9695.out
    data: |
      -27
      1
      15
